import { BrowserRouter, Routes, Route } from 'react-router-dom';
import ShoeList from './Shoes/ShoeList';
import ShoeForm from './Shoes//ShoeForm';
import ShoeDetail from './ShoeDetail';
import ShoePage from './ShoePage';
import BinForm from './BinForm';
import HatList from './HatList';
import MainPage from './MainPage';
import Nav from './Nav';
import "./App.css"


function App() {
  return (
    <BrowserRouter>
      <Nav />
      <div className="container appBody">
        <Routes>
            <Route path="/">
                <Route index element={<MainPage />} />
            </Route>
            <Route path="shoes">
                <Route index element={<ShoeList />} />
                <Route path="create" element={<ShoeForm />} />
                <Route path=":id" element={<ShoeDetail />} />
                <Route path="page" element={<ShoePage />} />
            </Route>
            <Route path="bins">
                <Route index element ={<BinForm />} />
            </Route>
          <Route path="/" element={<MainPage />} />
          <Route path="/shoes" element={<ShoeList />} />
          <Route path="/hats" element={<HatList />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
